INSERT INTO `aboutus` (`id`, `content`, `title`, `image`) VALUES
(1, '<p style=\"text-align: justify;\"></p><div style=\"text-align: justify;\"><div class=\"col-11 col-lg-11\" style=\"width: 1072.5px; padding-right: 15px; padding-left: 15px; flex-basis: 91.6667%; max-width: 91.6667%; color: rgb(33, 37, 41); font-family: Poppins, sans-serif; font-size: 15px; text-align: left;\"><p class=\"text-justify\" style=\"margin-right: 0px; margin-bottom: 25px; margin-left: 0px;\">Foundation for Spark Incubation Centre is a business incubation center of Sagar Smart City Limited. With programs specifically catering to entrepreneurs with profit ventures and social ventures, also student and women entrepreneurs, Foundation for Foundation for Spark Incubation Centre (SPARK) offers its support to various players of the startup ecosystem. This center is currently being managed by Incubation Masters.</p><p class=\"text-justify\" style=\"margin-right: 0px; margin-bottom: 25px; margin-left: 0px;\">Foundation for SPARK Incubation Center is an ambitious project of Sagar Smart City Limited Limited which is a sector agnostic business incubation center of Sagar. This incubation center aspires to create a culture of excellence &amp; nurture the young entrepreneurs by providing them with mentorship, technology support, funding facilitation, marketing guidance &amp; other required assistance they need to establish their entrepreneurial dream.</p></div><div class=\"col-11 col-lg-11\" style=\"width: 1072.5px; padding-right: 15px; padding-left: 15px; flex-basis: 91.6667%; max-width: 91.6667%; color: rgb(33, 37, 41); font-family: Poppins, sans-serif; font-size: 15px; text-align: left; margin-top: -10px !important;\"><br><h5 style=\"margin-right: 0px; margin-bottom: 25px; margin-left: 0px; font-weight: inherit; line-height: 3rem; font-size: 2.3rem; padding: 0px; letter-spacing: -0.5px; font-family: Poppins, sans-serif !important;\">Our Vision :</h5><p class=\"text-justify\" style=\"margin-bottom: 25px; margin-right: 0px; margin-left: 0px; margin-top: -17px !important;\">Our primary vision is to facilitate a platform for a budding entrepreneur to start a business venture with minimum risks and to create world class, self-sustaining business incubation facility &amp; innovation ecosystem that will nurture knowledge based, technologically differentiated, socially relevant ventures and creating economic impact on citizen of Smart City Sagar, Madhya Pradesh and our nation at large</p></div><div class=\"col-11 col-lg-11\" style=\"width: 1072.5px; padding-right: 15px; padding-left: 15px; flex-basis: 91.6667%; max-width: 91.6667%; color: rgb(33, 37, 41); font-family: Poppins, sans-serif; font-size: 15px; text-align: left; margin-top: -30px !important;\"><br><h5 style=\"margin-right: 0px; margin-bottom: 25px; margin-left: 0px; font-weight: inherit; line-height: 3rem; font-size: 2.3rem; padding: 0px; letter-spacing: -0.5px; font-family: Poppins, sans-serif !important;\">Our Mission:</h5><p class=\"text-justify\" style=\"margin-bottom: 25px; margin-right: 0px; margin-left: 0px; margin-top: -17px !important;\">The mission of Foundation for Spark Incubation Centre is to nurture and empower the next generation entrepreneurs to serve the local problems and to develop sustainable startup ventures in order to create jobs, revitalize community, commercialize new technology and strengthen local and national economy</p></div><div class=\"col-11 col-lg-11\" style=\"width: 1072.5px; padding-right: 15px; padding-left: 15px; flex-basis: 91.6667%; max-width: 91.6667%; color: rgb(33, 37, 41); font-family: Poppins, sans-serif; font-size: 15px; text-align: left; margin-top: -30px !important;\"><br><h5 style=\"margin-right: 0px; margin-bottom: 25px; margin-left: 0px; font-weight: inherit; line-height: 3rem; font-size: 2.3rem; padding: 0px; letter-spacing: -0.5px; font-family: Poppins, sans-serif !important;\">Focused Industry Verticals:</h5><p class=\"text-justify\" style=\"margin-bottom: 25px; margin-right: 0px; margin-left: 0px; margin-top: -17px !important;\">Technology, Internet, Urban Development, Waste Management, Cyber Security, Mobile, Greentech, Cleantech, Biotech, Healthcare, Gaming, Edutech, Data Analytics, SaaS, Sanitation, Manufacturing, Transport, Agriculture, Food &amp; Food Processing</p></div><ul type=\"disc\">\r\n</ul><ul type=\"disc\">\r\n</ul></div><ul style=\"\"><ul style=\"font-size: 16px;\"></ul></ul>', 'What is Foundation for Spark Incubation Centre', 'uploads/about/1632302934.jpg');
