INSERT INTO `post` (`pid`, `title`, `summary`, `content`, `date`, `status`, `image`, `aid`, `cid`, `tags`) VALUES
(2, 'Jabalpur based EdTech Startup HomeGuruji raises 25 Lakhs in Seed Funding', '   <h3><span style=\"font-size: 16px;\">HomeGuruji, a </span><a href=\"https://jicjabalpur.org/\" target=\"_blank\" style=\"background-color: rgb(255, 255, 255); font-size: 16px;\">Jabalpur Smart City Incubation Center </a><span style=\"font-size: 16px;\">backed Startup, mentored by </span><a href=\"https://www.linkedin.com/company/incubationmasters/\" target=\"_blank\" style=\"background-color: rgb(255, 255, 255); font-size: 16px;\">Incubation Masters </a><a style=\"color: rgb(0, 0, 0); background-color: rgb(255, 255, 255); font-size: 16px;\">, works as an aggregator and provides 1:1 class to the students, mostly from central India, raised Rs. 25 Lakhs in seed funding from a Pune based Angel Investor,</a><a href=\"https://www.linkedin.com/in/girjeshvyas/\" target=\"_blank\" style=\"background-color: rgb(255, 255, 255); font-size: 16px;\"> Girjesh Vyas</a></h3>', '    <p>Slowly but steadily, Madhya Pradesh Startups have started marking their presence in the startup map of the country. <a href=\"https://homeguruji.com/\" target=\"_blank\">HomeGuruji</a>, a <a href=\"https://jicjabalpur.org/\" target=\"_blank\">Jabalpur Smart City Incubation Center</a> Startup, mentored by <a href=\"https://www.linkedin.com/company/incubationmasters/\" target=\"_blank\" style=\"background-color: rgb(255, 255, 255);\">Incubation Masters</a>, works as an aggregator and provides 1:1 class to the students, mostly from central India, raises Rs 25 Lakhs in seed funding from a Pune based Angel Investor, <a href=\"https://www.linkedin.com/in/girjeshvyas/\" target=\"_blank\" style=\"color: rgb(0, 86, 179); background-color: rgb(255, 255, 255);\">Girjesh Vyas</a>. The funding was facilitated by <a href=\"https://jicjabalpur.org/\" target=\"_blank\" style=\"background-color: rgb(255, 255, 255);\">Jabalpur Smart City Incubation Center</a>, <a href=\"https://www.linkedin.com/company/incubationmasters/\" style=\"background-color: rgb(255, 255, 255);\">Incubation Masters</a> and <a href=\"https://hyderabadangels.in/\" target=\"_blank\">Hyderabad Angles</a></p><h3 style=\"font-family: \">HomeGuruji, an online 1:1 private classes solution in your local language</h3><p></p><p>Most of the popular and largest used learning apps in India currently are focused on English medium students. Some of these apps do have some content in Hindi medium, but still their maximum work and focus happens to be with the English medium learners. In India, there are a very large number of students studying in local languages and out of them, Hindi medium students are the largest of the lot. A report by DNA India in Dec 2016 had suggested that around 49% of all students in India study in Hindi medium Schools. Considering the number of students studying in the local languages and their need of modern learning solution in their local languages, Nikhil Bhatnagar the Founder of <a href=\"https://homeguruji.com/\" target=\"_blank\" style=\"color: rgb(0, 86, 179); background-color: rgb(255, 255, 255);\">HomeGuruji</a>, along with this team came up with this idea during COVID, where students from Hindi medium and English medium can fine tutors and notes in the platform.<a href=\"https://homeguruji.com/\" target=\"_blank\" style=\"color: rgb(0, 86, 179); background-color: rgb(255, 255, 255);\">HomeGuruji</a>  is now the community of more than 400+ Educators which includes the teachers from IIT’s, Nit’s, Delhi University, Jaipur University, who are teaching the students 1:1 live online at affordable prices.<br></p><h3 style=\"font-family: \">What does the Founder Say!</h3><p>According to the company statement, the startup will primarily use the fresh funds to upgrade their product, coach tools, and content that will enable better quality education. Established in 2020 by Nikhil Bhatnagar and team, the journey of <a href=\"https://homeguruji.com/\" target=\"_blank\" style=\"color: rgb(0, 86, 179); background-color: rgb(255, 255, 255);\">HomeGuruji</a> has been inspirational to many. The team has helped well over 1000 students during COVID and they are adding 10 new students on an average every day. The EdTech startup teaches all subjects form class 1 to 12 to children in the age group of 6-18 years in an interactive, small classroom of 3-5 children along with 1:1 classes. They have also launched a free video-based doubt solving platform for the students. <a href=\"https://homeguruji.com/\" target=\"_blank\" style=\"color: rgb(0, 86, 179); background-color: rgb(255, 255, 255);\">HomeGuruji</a> also serves the information heavy subjects using machine learning and natural language processing for interactive learning and practice and also plans to foray into the concept heavy competitive exam segment.<br></p><h3 style=\"font-family: \">Nikhil Bhatnagar, the Founder and CEO of HomeGuruji</h3><p>The story of the founder of <a href=\"https://homeguruji.com/\" target=\"_blank\" style=\"color: rgb(0, 86, 179); background-color: rgb(255, 255, 255);\">HomeGuruji</a> is inspirational. Nikhil Bhatnagar had started giving home tuitions right during his college days and soon he realized that there are many people who wish to teach even when they are in college. During this, he also realized that the absorption power of every student is not same, and each student needs special attention, some can grasp quickly but others may take it slow to understand the concepts. Therefore, he started 1:1 personalized classes and during COVID, he built the digital platform and leveraged the digital infrastructure to provide the tuitions digitally to the students.</p><h3 style=\"font-family: \">Road Ahead!</h3><p><a href=\"https://homeguruji.com/\" target=\"_blank\">HomeGuruji</a><a href=\"https://homeguruji.com/\"> </a>is not only helping Parents to choose the perfect tutor for their child but also helping the number of youths to earn a good amount by sharing their knowledge, and in these all things can be done by sitting in the room of their home. Nobody has to step out of their home for Quality Education. <a href=\"https://homeguruji.com/\">HomeGuruji</a> is now not only the curriculum-based educator provider but also in different fields so that we can bring the overall development in the child. Here we not only teach the school subjects but also helps the student to be the better citizen. We mean that Education is for all and also focusing in the same, we are not only helping the poor students in studies but also focusing on the students who are in small schools and doesn\'t have resources to study well. <a href=\"https://homeguruji.com/\">HomeGuruji</a> now aspires to scale up their services in different cities and states and even abroad with their special Mathematics classes.</p><p><br></p><h3>About Jabalpur Smart City Incubation Center (JIC)</h3><p> <img src=\"data:image/png;base64,\" data-filename=\"image.png\" style=\"width: 111px;\">   </p><p>This center was launched in November 2017 and have incubated more than 100 startups since then there are many success stories of <a href=\"https://jicjabalpur.org/\" target=\"_blank\">Jabalpur Incubation Center</a> and <a href=\"https://homeguruji.com/\" target=\"_blank\" style=\"color: rgb(0, 86, 179); background-color: rgb(255, 255, 255);\">HomeGuruji</a> is another feather in the cap. Jabalpur Incubation Center is built and funded by <a href=\"https://jscljabalpur.org/\" target=\"_blank\">Jabalpur Smart City</a> Limited, Government of Madhya Pradesh and managed by <a href=\"https://www.linkedin.com/company/incubationmasters/\" target=\"_blank\" style=\"background-color: rgb(255, 255, 255);\">Incubation Masters</a>. This is one of the most effective and impactful Government backed Incubation Center of the country and anchoring the startup ecosystem of central India, Madhya Pradesh.</p><h3>About Incubation Masters (IM)</h3><h3><img src=\"data:image/jpeg;base64,\" data-filename=\"unnamed.jpg\" style=\"color: inherit; font-family: inherit; font-size: 1rem; width: 111px;\"></h3><p class=\"MsoNormal\" style=\"margin-bottom: 0.0001pt; line-height: normal;\"><span candara\",sans-serif;=\"\" mso-fareast-font-family:\"times=\"\" new=\"\" roman\";mso-bidi-font-family:\"times=\"\" roman\"\"=\"\"> <a href=\"https://www.linkedin.com/company/incubationmasters/\" target=\"_blank\">Incubation Masters</a>  is an incubation, startup, trade and export promotion consulting organization working with smart cities and universities of India and abroad. Currently working with 500+ startups mostly from tier 2 and tier 3 cities of India and helping the local administration nurturing the startup and innovation ecosystem. </span></p><p class=\"MsoNormal\" style=\"margin-bottom: 0.0001pt; line-height: normal;\"><br></p><p class=\"MsoNormal\" style=\"margin-bottom: 0.0001pt; line-height: normal;\"><span candara\",sans-serif;=\"\" mso-fareast-font-family:\"times=\"\" new=\"\" roman\";mso-bidi-font-family:\"times=\"\" roman\"\"=\"\"></span></p><h3 style=\"margin-bottom: 0.0001pt; line-height: normal;\">About Hyderabad Angles (HA)</h3><p><a href=\"https://hyderabadangels.in/\" target=\"_blank\">Hyderabad Angles</a> is a platform for connecting established angel investors and new generation entrepreneurs with innovative business ideas. Established in the year 2012, with the objective of nurturing aspiring entrepreneurs, HA, today, invests in promising start-ups globally to create tangible as well as intangible value.</p> ', '2021-04-17', 1, '161900703916186528681.jpeg', 2, 2, 'Jabalpur Startups, Startup Funding, Funding Alter, Edtech Funding, HomeGuruji, Incubation Masters, Jabalpur Smart City, Smart City Incubation Center');
