INSERT INTO `services` (`id`, `service_name`, `content`, `image`) VALUES
(1, 'Mentoring', '<p><span style=\"color: rgb(33, 37, 41); font-family: Poppins, sans-serif; font-size: 15px; text-align: justify;\">Right guidance at the right time saves an entrepreneur precious time otherwise spent in re-inventing the wheel! Realising this, we connect you with experienced mentors who help you think strategically and grow exponentially.</span><br></p>', 'uploads/services/1632397268.jpg'),
(2, 'Launchpad', '<p><span style=\"color: rgb(33, 37, 41); font-family: Poppins, sans-serif; font-size: 15px; text-align: justify;\">Right environment can make all the difference in the early days of your venture when the foundation is being laid. We provide you an inspiring co-working environment with the right mix of creativity, expert guidance, practical advice and interaction with peers.</span><br></p>', 'uploads/services/1632397750.jpg'),
(3, 'Incubation', '<p><span style=\"color: rgb(33, 37, 41); font-family: Poppins, sans-serif; font-size: 15px; text-align: justify;\">We incubate early-stage companies that demonstrate potential to innovate, implement and create social/financial impact</span><br></p>', 'uploads/services/1632397772.jpg'),
(4, 'Student Run Ventures', '<p><span style=\"color: rgb(33, 37, 41); font-family: Poppins, sans-serif; font-size: 15px; text-align: justify;\">We help you ideate, test, build prototype and launch your venture. This program is specifically meant for all interested students enrolled in long duration degree granting programme (PGP, PGSEM, PGPEM, PGPPM, EPGP and FPM) who need hand-holding to field-test their business ideas before they convert this into a true entrepreneurial venture.</span><br></p>', 'uploads/services/1632399727.jpg'),
(5, 'Women Startup Program', '<p><span style=\"color: rgb(33, 37, 41); font-family: Poppins, sans-serif; font-size: 15px; text-align: justify;\">venture. The Program is designed to focus on enhancement of the entrepreneurial and managerial skills of women leading early and ideation stage ventures.</span><br></p>', 'uploads/services/1632399751.jpg'),
(6, 'Prototype building lab', '<p><span style=\"color: rgb(33, 37, 41); font-family: Poppins, sans-serif; font-size: 15px; text-align: justify;\">Spark Incubation Centre facilitates the innovators/startups to build their ideas into prototypes/products. Our lab acts as a springboard for the innovators by helping them nurture their ideas through its digital fabrication and prototyping facilities. We have exquisite range of fabrication and testing facilities such as 3D Printing, PCB printing, CNC manufacturing and metal working, IoT Kits, Electronic circuit testing, Embedded computing and Network devices. We also assist the innovators to complete their projects through its knowledge network.</span><br></p>', 'uploads/services/1632399781.jpg');
