(364, '8889828887', 'kvishwakarma412@gmail.com', 'RBA Pvt. Ltd.', '1', '', 'Social welfare and development', '8', '2020', 'Hardware\r\nIT management consultants.\r\nWeb applications.\r\nprovide tech education services\r\nAdvisory', 'We provide both online offline services\r\nGood teamwork and passion for results', 'B2C', 'In view of this epidemic, the government decided to close schools, colleges and companies so that the epidemic does not spread much.\r\nConsolidation of children in school or college can increase infection, so online education was started so that children can continue their studies while staying at home. But only children can study in homes where there is a computer or laptop.\r\nWe are offering good computer laptops at lowest cost to families who cannot afford high cost laptop computers to their kids', NULL, NULL, '2021-07-15 20:22:49', 'on', 'SAGAR', 470002, 'Madhya Pradesh', '2', 0, 'pending'),
