(365, '9560936464', 'agamrjain@gmail.com', 'Puru Technologies', 'Early_Revenues', 'https://www.purutechnologies.com', 'Healthcare', '8', '2019', 'Puru Hospital Automation\r\n	- Radiology Department\r\n		- PACS, Real-time CTScan etc viewing capability ( Filmless system ), TeleRadiology\r\n		- Link to digital brochure https://bit.ly/36ZtaIJ\r\n	- Barcode based Inventory And Online Indent Management\r\n	- Online Indent Management System\r\n	- Pathology Lab Automation & Online System\r\n	- Patient Management System', 'Agam Jain - Senior Software Developer with 6+ Years of industry exprience in Java, Python, Angular, Various database systems.  Trained in Google Cloud, AWS. Researcher in Bio-Medical & Computer Vision, IEEE Fellow\r\n			\r\nAditya Raj Jain - He graduated in BSc. Computer Science ( Hons. ) from Delhi University. He is well versed in Python & NodeJS. His field of work is UI And UX. He was elected as Central Counselor Ramanujan Collage ( Delhi University )', 'B2B', '1. We guaranty 99.9% uptime to our customer. Our Customer testimony backs our claim.\r\n2. We develop responsive web-apps, so that our customer can access portal(s) over any device. \r\n3. Fraction of cost as compared to our competitive.\r\n6. It is using updated Health Protocol which can allow hospital to submit data to govt flawlessly.\r\n5. Developed using latest and reliable technologies which makes it fast and adaptable to any upcoming requirement.\r\n6. Complete hospital under single click. ', NULL, NULL, '2021-07-20 05:52:25', 'on', 'Sagar', 470004, 'Madhya Pradesh', '', 1, ''),
(366, '9713287987', 'vipendra.s31@gmail.com', 'SMART HOME SERVICES', 'Ideation', '', 'Citizen Services', '6', '2021', 'THE FIRST PHASE OF SERVICES IS \r\n1/HOME ELECTRICIAN SERVICE. AND HOME PLUMBER SERVICE.\r\n2/HOME CARPENTER SERVICE. AND HOUSE  PAINTER. \r\n3/SALOON FOR MEN.S AND  WOMEN,S.\r\n4/HOME APPLIANCE REPAIR AND PHOTOGRAPHER AND CAR DRIVER\r\n5/TIFFIN SERVICE AND  LIGHT DECORATION .BIRTHDAY CAKE \r\nTHE SECOND PHASE OF SERVICES IS \r\n1/SPOKEN ENGLISH CLASS,.GRAMMAR  CLASS .MUSIC CLASS,INSTRUMENTAL CLASS,SUBJECT CLASS 1 TO 12 \r\nCOACH SERVICE ,GYM TRAINER , YOGA TRAINER.\r\nTHE THIRD PHASE  OF SERVICES IS \r\nCAR RENTAL SERVICES\r\n', 'VIPENDRA SINGH  SENGAR  (M,SC IN COMPUTER  SCIENCE, BED ), JITENDRA ATHIYA (CIVIL ENGINEER) ,PANKAJ BILTHARE(MBA)  KIRAN THAKUR (MA IN POLITICAL SCIENCE AND MA IN HISTORY. DLED) ', 'B2C', '1/OUR EMPLOYEES  WILL BE  PROFESSIONALLY TRAINED.\r\n2/SERVICE COST IS MINIMUM.\r\n3/THE SERVICE WILL BE DELIVERED IN MINIMUM TIME. ', NULL, NULL, '2021-07-21 07:46:04', 'on', 'Sagar', 470004, 'Madhya Pradesh', '', 1, ''),
(367, '8518871350', 'arvindvish2588@gmail.com', 'RoomNearYou', 'Beta_Launched', 'https://roomsnearyou.in/', 'Other', '6', '2021', 'RoomsNear is an first online rooms, apartments, flats, etc rental aggregation website for peoples in need of independent and comfortable living spaces in your city Sagar, Madhya Pradesh By the partnering with property owners and landlords we provide the verified listing to you. Our website mostly focus on the students who are seeking for comfortable rooms, So that book the room from anywhere you are and after confirmation just go and stay your booked room.', '1) Shrikant Dwivedi - Frontend Developer\r\n2) Arvind Vishwakarma - Backend Developer\r\n', 'B2C', 'Book Rooms From Anywhere: \r\nDue to this pendamic situation no one whats to leave home for find room. So we are here for a better option for help you to find your room from enywhere.\r\n\r\nJust Find Rooms in sagar city and book any room as your fit. The landlord details share with your after booking and your details share with the room\'s landlord.\r\n\r\nFree To Use:\r\n\r\nWe don\'t cost you any single of money, so its totally free for all tenants. Just book any room free of cost and direct contact to the landlord', NULL, NULL, '2021-07-23 12:01:22', 'on', 'Sagar', 470002, 'Madhya Pradesh', '', 1, ''),
(341, '7879553208', 'info.subdha@gmail.com', 'Subdha Marketplace', 'Beta_Launched', 'https://subdha.com', 'Information Technology', '10', '2020', 'Our Application is for small business who want to service there service in certain geo location area. and we are offer shared resource for multipoles  business owner so lot\'s of business get lowest price of the product/service. our application platform already  successfully pass the beta test. now we are locking for scale the reach in the Sagar city. ', '** Right now we have 4 core members team. (and 5 Part time support person)\r\n** All Team Member Are Graduated and 1.5 year experienced in job.\r\n** Our Team Lead (Shekhar Patel) 2.5years Job experienced in Software Company in Bangalore.\r\n** Every Team Member has Leadership quality. \r\n ', 'B2C', '** lots of Service are available in the market, but these service is not reaching to every one.\r\n** we Implement on ground label.\r\n** We have a read world problem solution (Market Want Out Product).\r\n** Right action on Right Time\r\n** \r\n', NULL, NULL, NULL, 'on', 'Sagar', 470002, 'Madhya Pradesh', '', 1, ''),
(344, '9399600098', 'careplussurgicalgroup13@gmail.com', 'Care+ Surgical Group', '1', '', 'Healthcare', '0', '2021', 'We are the medtech start up from medtech field and we are going to manufacture the surgical gloves and nitrile gloves.', 'The key person is Saarthak Gupta having MBA in International business with the experience of 3 year working with start up.', 'B2B', 'We are the first one in india who are going to manufacture the nitrile gloves and again we are the one who come forward with one solution of two biggest problem under the one roof that it rubber waste management and health and medtech management.', NULL, NULL, NULL, 'on', 'Sagar', 470001, 'Madhya Pradesh', '', 1, ''),
(345, '7470469126', 'imsamj82@gmail.com', 'SAUDA', '1', '', 'Other', '6', '2020', 'MY PRODUCT IS A (FMCG B2B E-COMMERCE HYPER-LOCAL MARKETPLACE)  ENABLES WHOLESALERS AND MANUFACTURERS SELL THEIR PRODUCTS AND SERVICES TO LOCAL SHOPS AND SHOPS LOCATED NEARBY AREAS AT CHEAPER PRICES FROM MARKET .', 'I AM NOT HAVING A TEAM YET BUT I AM IN TALKS WITH SOME PEOPLE.\r\nPLEASE DON\'T GO WITH THE WORDS BECAUSE I CANNOT EXPLAIN MY WHOLE IDEA IN A SHORT SUMMARY BUT I CAN EXPLAIN IT A LOT BETTER IN FRONT OF THE MENTORS.', 'B2B', 'MY PLATFORM IS DIFFERENT FROM OTHER PLATFORMS AS WE WILL PROVIDE ON-GROUND SERVICES LIKE CUSTOMERS DON\'T HAVE TO GO FOR EVERYDAY SHOPPING FOR RESTOCKING THEIR SHOPS AS WE WILL PROVIDE SAME DAY DELIVERIES AND BACK END SUPPORT TO CUSTOMER AND SELLERS BOTH OUR SERVICES WILL INCLUDE WAREHOUSING AND LOGISTICS ', NULL, NULL, NULL, 'on', 'Sagar', 470001, 'Madhya Pradesh', '', 1, 'pending'),
