(347, '7470469126', 'imsamj82@gmail.com', 'SAUDA', '1', '', 'Other', '6', '2020', '\"SAUDA\" is a B2B e-commerce platform for wholesale and retail businesses \r\n*platform offers a wide variety of goods mainly focused on FMCG sector and packaged foods, because there is no similar platform for now,\r\n*it is different from other e-commerce platforms because it enables small stores and shops to buy goods from the nearest wholesale market at cheapest rates from the market and get delivered to their shops.', 'no team for now except me but in talks with others.', 'B2B', '*it is different from other e-commerce platforms because it enables small stores and shops to buy goods from the nearest wholesale market at cheapest rates from the market and get delivered to their shops.\r\n*there is no One sector centric platform now\r\n*there is no other platform dedicated to small businesses at a local level.', NULL, NULL, NULL, 'on', 'Sagar', 470004, 'Madhya Pradesh', '', 1, ''),
