(352, '7470891578', 'animeshj078@gmail.com', 'Animesh Jain', '1', '', 'Other', '7', '2021', 'We can create job by our business idea,we will create a platform on which different cooks(housewife, students and others) can register and open a restaurant online we will verify the every registered person after checking the factors like sanitation, cleanliness etc (and they can cook from their home)n then only we give verified tick,their will  a option for cooks to accept consumer request or not if they will not expect request be transferred to other.this will generate women employment ', 'CEO-Animesh jain\r\nCurrently a B.Tech student at igec sagar', 'B2C', 'Since in our startup a very small investment is required, and we know that many of the women, students are good cooks but currently they are unemployed ,so we can provide employment to them,and counter the monopoly of big restaurant and hotels', NULL, NULL, NULL, 'on', 'Sagar', 470227, 'Madhya Pradesh', '', 1, ''),
(353, '8889828887', 'kvishwakarma412@gmail.com', 'K.v Future Services', '1', '', 'Information Technology', '7', '2019', 'Our company is doing lowest cost computer assembling to promote Digital India.\r\n. We offer 8500 to 12000 rupees for those who can\'t afford expensive mobile or computer laptop for their kids. So that their children can continue their studies and learn more at home for their studies.Digital solutions for our customers to grow business', 'There are currently 5 people in our team who are working in the city and village and understanding the needs of the people and providing them with products and services to solve their problems.We are trying that more people join our team and move forward for success.', 'B2C', 'Our team works great together, considering the requirement of the customer, we provide the product to the customer and provide solutions to the difficulties.', NULL, NULL, NULL, 'on', 'Sagar', 470002, 'Madhya Pradesh', '', 1, ''),
